-- ----------------------------
--  Table structure for `question`
-- ----------------------------
DROP TABLE IF EXISTS `question`;
CREATE TABLE `question` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `question_group_id` int(11) NOT NULL,
  `question_type_id` int(11) NOT NULL DEFAULT '0',
  `sort_order` int(11) NOT NULL,
  `number` varchar(40) DEFAULT NULL,
  `name` varchar(1024) DEFAULT NULL,
  `summary` varchar(500) DEFAULT NULL,
  `description` varchar(5000) DEFAULT NULL,
  `importance` int(11) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  KEY `question_group_id_index` (`question_group_id`),
  KEY `question_type_id_index` (`question_type_id`),
  CONSTRAINT `question_ibfk_1` FOREIGN KEY (`question_group_id`) REFERENCES `question_group` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=80 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
--  Records of `question`
-- ----------------------------
BEGIN;
INSERT INTO `question` VALUES ('1', '1', '1', '1', '1', 'Strategic Direction Alignment', null, 'Aligns information skills and resources with, and is supportive of, the strategic directions of\nthe parent organization or of key client groups through partnerships with key stakeholders and\nsuppliers.', '1'), ('2', '1', '1', '2', '2', 'Stakeholder Inclusion', null, 'If managing a centralized information department or library, assesses and communicates the\nvalue of that organizational asset, including information services, products and policies to senior\nmanagement, key stakeholders and client groups.', '1'), ('3', '1', '1', '3', '3', 'Sound Business Judgement', null, 'Establishes effective management, operational and financial management processes and\nexercises sound business and financial judgments in making decisions that balance operational and\nstrategic organizational considerations.', '1'), ('4', '1', '1', '4', '4', 'Effective Contributions', null, 'Contributes effectively to senior management strategies and decisions regarding information\napplications, tools and technologies, and policies for the organization.', '1'), ('5', '1', '1', '5', '5', 'Personal and Professional Development', null, 'If managing a centralized information department or library, builds and leads an effective\ninformation services team and champions the professional and personal development of team\nmembers.', '1'), ('6', '1', '1', '6', '6', 'Active Engagement', null, 'Actively seeks out opportunities to demonstrate and contribute professional expertise to\nadvance the organizations or clients strategic goals.', '1'), ('7', '1', '1', '7', '7', 'Evidence Based Decision Making', null, 'Gathers the best available evidence to support decisions about the development of new\nservices and products, the modification of current services, or the elimination of services to\ncontinually improve the strategic value of information services provided.', '1'), ('8', '1', '1', '8', '8', 'Intellectual Property Understanding', null, 'Advises the organization and/or client on copyright and intellectual property issues and\ncompliance.', '1'), ('9', '2', '1', '9', '1', 'Communcation with Leadership and Stakeholders', null, 'Communicates regularly with organizations leadership and stakeholders to understand and\naddress information needs and gaps, devices and workflow tools being used, and business\npriorities.', '1'), ('10', '2', '1', '10', '2', 'Policy Development and Adherence', null, 'Develops policies for externally-published and internally-created information and knowledge\nassets under management; advises on the implementation of these policies, including copyright\ncompliance, privacy, and intellectual property protection.', '1'), ('11', '2', '1', '11', '3', 'Staying Up-to-Date', null, 'Actively monitors the continuously-expanding universe of information resources, including\npublications, databases, data sets, and social media, and tools for text-mining, data mining, or data\nvisualization, and then matches resources to client groups within the organization.', '1'), ('12', '2', '1', '12', '4', 'Maintaining Breadth and Depth', null, 'Manages a dynamic portfolio of information resources and services aligned with the strategic\ngoals of the organization and designed to facilitate learning, decision-making and mitigation of\nrisks.', '1'), ('13', '2', '1', '13', '5', 'Understanding of Existing Assets', null, 'Maps information and knowledge assets available within the organization in order to advise\nclients regarding resources relevant to various business activities.', '1'), ('14', '2', '1', '14', '6', 'Custom Service Provision', null, 'Delivers custom services, including consulting, training, curation, in-depth research, data\nanalysis, briefings and alerts, database design, and metadata and taxonomy development.', '1'), ('15', '2', '1', '15', '7', 'Information Synthesis', null, 'Researches, analyzes and synthesizes information into actionable steps or accurate answers to\nefficiently and effectively deliver on client assignments.', '1'), ('61', '2', '1', '16', '8', 'Proactive Knowledge Acquisition', null, 'Proactively introduces to the organization tools and technology that offer productivity gains in\nterms of access, sharing, and integration of information and knowledge.', '1'), ('62', '2', '1', '17', '9', 'Licensing Evaluation', null, 'Critically evaluates and negotiates fees and licensing terms for subscription-based information\nproducts and services.', '1'), ('63', '2', '1', '18', '10', 'Open Source Alternative Usage', null, 'Identifies and provides pointers to high-quality, business-relevant, open source and Internet\nresources.', '1'), ('64', '2', '1', '19', '11', 'Quality Assurance', null, 'Designs consistent repeatable data and analytics reporting and collects anecdotal evidence\nto measure the quality and value of information offerings, and to take appropriate action to ensure\nthe relevancy of all offerings within the portfolio.', '1'), ('65', '3', '1', '20', '1', 'Emerging Technologies Awareness', null, 'Maintains awareness of emerging technologies and their implications for service provision;\nadvises and champions, where necessary, introduction of such technologies in their organization.', '1'), ('66', '3', '1', '21', '2', 'Database Technologies', null, 'Keeps up to date and applies expertise in searching as well as database development ,\nindexing, metadata, and information analysis and synthesis to improve retrieval and use of internal\nand external information.', '1'), ('67', '3', '1', '22', '3', 'External Service Usage', null, 'Assesses, selects and applies current and emerging information technologies and services\n(e.g., databases, catalogs, search engines, websites and social media) and uses these to create\ninformation access and delivery solutions.', '1'), ('68', '3', '1', '23', '4', 'Information Privacy', null, 'Protects the information privacy/data of clients.', '1'), ('69', '3', '1', '24', '5', 'Intellectual Property', null, 'Protects intellectual property rights and\nmaintains awareness of, and responses to, new challenges to privacy/data protection or\nintellectual property rights.', '1'), ('70', '3', '1', '25', '6', 'Knowledge Sharing', null, 'Teaches and advises on the use of information technologies and services throughout their\norganization.', '1'), ('73', '4', '1', '26', '1', 'Time Management', null, 'Plans, prioritizes and focuses on what is critical, based on the strategic goals of the parent\norganization.', '1'), ('74', '4', '1', '27', '2', 'Innovation', null, 'Is innovative in applying information services and skills.', '1'), ('75', '4', '1', '28', '3', 'Adaptability', null, 'Is adaptable, flexible, and able to transition into new roles and responsibilities to meet the\nchanging needs of the organization.', '1'), ('76', '4', '1', '29', '4', 'Opportunity Recognition', null, 'Seeks out challenges and prepares for, and capitalizes on, new opportunities.', '1'), ('77', '4', '1', '30', '5', 'Communication', null, 'Actively listens and problem solves, and communicates effectively.', '1'), ('78', '4', '1', '31', '6', 'Ethics', null, 'Builds an environment of mutual respect and trust; respects and values diversity.', '1'), ('79', '4', '1', '32', '7', 'Team Membership', null, 'Develops interpersonal skills to influence and employs a team approach; recognizes the\nbalance of collaborating, leading and supporting.', '1');
COMMIT;

