-- ----------------------------
--  Records of `question_group`
-- ----------------------------
BEGIN;
INSERT INTO `question_group` VALUES ('1', '1', 'Creating and Maintaining Collaborative Relationships', 'A', '1', null, 'In order to effectively contribute their expertise, information professionals must be skilled at building\nand maintaining positive, trust-based, collaborative relationships with key stakeholders. Depending on \n3\nthe information professionals work environments, key stakeholders may include Information Center\nusers, organization management, fellow team/department members, or clients, among others. (The\nterm organization is used broadly here, encompassing corporate, education, public, government, nonprofit,\nand other entities.) Information professionals excel at identifying, contributing, and managing\nhigh-value information assets for organizations and clients whose markets are constantly changing and\nin which both high-tech and high-touch are vitally important to achieving organizational success.'), ('2', '1', 'Managing Information Services and Resources', 'B', '2', null, 'Information professionals work with leadership of the organizations in which they are employed to\nthoroughly understand business objectives. With that knowledge, they continuously assess informationseeking\nbehaviors and needs of colleagues to implement a strategy for procuring and providing access to\na portfolio of services and resources that are designed to enhance learning, productivity, and\ncompetitive advantage.'), ('3', '1', 'Understanding and Applying Information Tools and Technologies', 'C', '3', null, 'Information professionals harness the current and appropriate technologies and systems to deliver the\nbest services; provide the most relevant and accessible resources; develop and deliver teaching in\ninformation literacy to maximize clients\' use of information and capitalize on the library and information\nenvironment of the 21st century'), ('4', '1', 'Personal Competencies', 'D', '4', null, 'Personal competencies both underlie and drive the value provided by an information professional.');
COMMIT;

